import homeCard from './OOS';
import { motion } from 'framer-motion';
import background from "./bg.png";


let card={width: 160, height:100, backgroundColor:"#fff",
 margin:10, 
 borderRadius:12, 
 textAlign:'center', 
 boxShadow: "0px 4px 10px 0px rgba(65, 95, 255, 0.25)",
 opacity: 0.8,
// color: "#415FFF"
}

let homeHover={
  scale: 1.3,
}


function App() {


 return (
    <div>

  <homeCard />
  <motion.h1 style={{padding:30}}
  animate={{
  fontSize: 60, 
  color: "#333",
 // color: "#415FFF",
   x: 60, 
   y: 0
   }}

  transition={{ type:"spring", velocity: 120 }}  
   >
  OOS动效平台
  </motion.h1>

   <div id='homebox'>
   <motion.div whileHover={{homeHover}} style={card} ><p style={{paddingTop:40}}>列表</p></motion.div>
   <div style={card} ><p style={{paddingTop:40}}>弹窗 </p></div>
   <div style={card} ><p style={{paddingTop:40}}>界面跳转 </p></div>
   <div style={card} ><p style={{paddingTop:40}}>选择类</p> </div>
   <div style={card} ><p style={{paddingTop:40}}>其他类 </p></div>
   </div>
   <div style={{marginLeft: 180, marginTop:-580}}>
   <div style={card} ><p style={{paddingTop:40}}>点击反馈</p> </div>
   <div style={card} ><p style={{paddingTop:40}}>提升类 </p></div>
   <div style={card} ><p style={{paddingTop:40}}>删除类 </p></div>
   <div style={card} ><p style={{paddingTop:40}}>展开折叠类</p> </div>
   </div>
   <div style={{ backgroundImage: `url(${background})` ,width: 375, height:812, position: 'absolute' , top: 0, 
   opacity: 1, 
zIndex: '-1'}}></div>

   </div>
  )
}

export default App;
